function getMarkerPoint(micelloGeom) {

    if(micelloGeom.gt == 2) {
        //AREA CASE
        //quick and dirty marker calculation - NOT VERY GOOD!

        var averageX = 0;
        var averageY = 0;
        //dont' take close or last point (repeat of first)
        var numPoints = micelloGeom.shp.length-2;

        //function to add to average
        var addToAverage = (pointInstruction,index) => {

            //we don't handle compound geometries properly
            //we get a moce instruction in themiddle of the geom
            if((pointInstruction[0] == 0)&&(index != 0)) {
                throw new Error("Compound geometry - not currently implemented in marker point calc!");
            }


            if(index < numPoints) {
                averageX += pointInstruction[1];
                averageY += pointInstruction[2];
            }
        }

        //process points
        micelloGeom.shp.forEach(addToAverage);

        //return marker point
        return [averageX/numPoints,averageY/numPoints];
    }
    else if(micelloGeom.gt == 0) {
        //POINT CASE - reuse point
        return micelloGeom.shp
    }
    else {
        //no marker if not an area or point
        return null;
    }
}

